import * as React from 'react';

import { MessageContext } from './context';

/**
 * Container
 * Provider of data
 * @param props
 */
export const NameProvider = (props: any) => {
  return <MessageContext.Provider value={{ name: 'Cavo' }}>{props.children}</MessageContext.Provider>;
};
